import React, { useState } from 'react';
import PhotoUpload from './components/PhotoUpload';
import axios from 'axios';
import Header from './components/Header';

function App() {
  const [imageURL, setImageURL] = useState(null);

  const handleImageUpload = async () => {
    try {
      // Отправьте запрос на сервер FastAPI, чтобы получить URL загруженного изображения
      const response = await axios.get('/images/your_image_filename.jpg');
      setImageURL(response.data.image_url);
    } catch (error) {
      console.error('Ошибка при получении изображения', error);
    }
  };

  return (
    <div className="App">
      <Header />
      <PhotoUpload />
      {imageURL && (
        <div>
          <img src={imageURL} alt="Загруженное изображение" />
        </div>
      )}
      <button onClick={handleImageUpload}>Показать загруженное изображение</button>
    </div>
  );
}

export default App;
